<script lang="ts" setup>
const countries = ref();
const abilityTooltip = ref(false);


const props = defineProps({
    statistics: {
        type: Array,
        required: true
    }
})

const regionController = async () => {
    const options = {
        method: "GET",
        headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${localStorage.getItem("Authorization")}`
        }
    }

    await apiDataFetch(`${uri}/stats/regions/`, options)
        .then(response => response.json())
        .then(response => {
            const data = response.regions;

            data.forEach((element: { region: string, visits: number }, index: number) => {
                props.statistics.push(element as never)
            });
        })
}

const tooltip = ref({
    top: 0,
    left: 0,
    content: "",
    counter: 0,
})

const getIcons = async () => {
    // await regionController();
    const path = countries.value.querySelectorAll("svg > path");
    for (let i = 0; i < path.length; i++) {
        path[i].addEventListener("mouseenter", onMouseEnter)
        path[i].addEventListener("mouseleave", onMouseLeave)
    }
}

const showTooltip = () => {
    abilityTooltip.value = !abilityTooltip.value;
}

const onMouseEnter = async (event: any) => {
    const attr = event.target.getAttribute("title");
    tooltip.value.content = attr;

    showTooltip()
}

const onMouseLeave = () => {
    abilityTooltip.value = false;
    tooltip.value.top = 0;
    tooltip.value.left = 0;
}


onMounted(() => {
    getIcons()
})
</script>

